import React, { useEffect } from "react";
import axios from "axios";
function DashBoard() {
  useEffect(async () => {
    try {
      const data = await axios.get("//localhost:5000/api/room/getallrooms");
      console.log(data.data);
    } catch (error) {
      console.log(error);
    }
  });

  return (
    <div>
      <h1>Roooms</h1>
    </div>
  );
}

export default DashBoard;
